START TRANSACTION;
alter table implant_data add column patient_id BIGINT(19) default null;



update patient p, implant_data di set p.implant_data_id =di.id where p.id = di.patient_id and p.id < 1000;

update implant_data
set rvad_data_brand_id = null,rvad_data_blood_flow_type_id=null,rvad_data_implant_in_id=null,rvad_data_implant_out_id=null,rvad_data_initial_flow=null
where patient_id < 1000 and implant_type_id<>218 and implant_type_id<>219;

alter table implant_data drop COLUMN patient_id;

COMMIT;